import React, {Component} from "react";
import TreePanel from "./treePanel";
import Tree from "./tree";
import {range, townCentre, defense, barracks, stable, castle, siege, monastery, blacksmith, university, economy, dock} from "./UNIT_NAMES";
import {CURRENT_CIV} from "../civPanel";

import { createContext } from "react";
const { Consumer } = createContext();
export default class TreeParent extends Component {
    
    constructor(props) {
        super(props);
        this.state = {civ: ""};
        this.printContext = this.printContext.bind(this);
        
    }

    printContext(context) {
        console.log(context);
    }

    

    render() {
        
        return(
            <Consumer>
                {context => (
                    
            <div>
                <table>
                    <tbody>
                        <tr>
                        <TreePanel build="Archery Range" tree={range}/>
                        <TreePanel build="Barracks" tree={barracks}/>
                        <TreePanel build="Stable" tree={stable}/>
                        {this.printContext()}
                        </tr>
                        <tr>
                        <TreePanel build="Siege Workshop" tree={siege}/>
                        <TreePanel build="Castle" tree={castle}/>
                        <TreePanel build="Defense" tree={defense}/>
                        </tr>
                        <tr>
                        <TreePanel build="Blacksmith" tree={blacksmith}/>
                        <TreePanel build="University" tree={university}/>
                        <TreePanel build="Monastery" tree={monastery}/>
                        </tr>
                        <TreePanel build="Town Center" tree={townCentre}/>
                        <TreePanel build="Economic Buildings" tree={economy}/>
                        <TreePanel build="Dock" tree={dock}/>
                    </tbody>
                </table>
            </div>
                )}
            </Consumer>
            
        )
        
    }
}
